public void init()
{
    super();

    switch (element.args().dataset())
    {
        case tableNum(CustPackingSlipTrans) :
            const int TabLines= 2;
            CustPackingSlipTrans custPackingSlipTrans = element.args().record() as CustPackingSlipTrans;
            QueryBuildDataSource queryDataSource = this.query().dataSourceTable(tableNum(VendPackingSlipTrans)).addDataSource(tableNum(TradePackingSlipTransChain));

            queryDataSource.relations(true);
            queryDataSource.joinMode(JoinMode::ExistsJoin);
            queryDataSource.addRange(fieldNum(TradePackingSlipTransChain, CustPackingSlipTrans)).value(queryValue(custPackingSlipTrans.RecId));
            tab.tab(TabLines, AutoMode::Fixed);
            break;
    }
}

public void linkActive()
{
    this.query().validTimeStateAsOfDateTime(vendPackingSlipVersion.VersionDateTime);
    isVersionArchived = vendPackingSlipVersion.isArchived();

    super();
}

public void linkActive()
{
    super();

    Object callerFormObject = element.args().caller();

    if (callerFormObject && formHasMethod(callerFormObject, identifierStr(versioningTimeStamp)))
    {
        VendPackingSlipVersion  localVendPackingSlipVersion;

        select firstonly localVendPackingSlipVersion
            order by VersionDateTime desc
            where localVendPackingSlipVersion.VendPackingSlipJour == vendPackingSlipJour.RecId
               && localVendPackingSlipVersion.VersionDateTime <= callerFormObject.versioningTimeStamp();

        if (localVendPackingSlipVersion.RecId)
        {
            vendPackingSlipVersion_ds.positionToRecord(localVendPackingSlipVersion);
        }
    }
}
